  return (

       <Container style={{ marginTop: 100 }}>
            <Row>
              <Col size="md-12"></Col>
          </Row>  
          <Row>
              <Col size="md-12">
                  <div className="headline">
                      <h1>About Me</h1>
                  </div>
              </Col>
          </Row>
          <Row>
              <Col size="md-3">
              <img alt="Joel Straley Headshot" className="img-fluid rounded headshot"/>
              </Col>
          </Row>
      </Container> 

      );
}

export default About;
